						<script>
			$( document ).ready(function() {
			    var clipboard = new Clipboard('#clip');

				clipboard.on('success', function(e) {
					swal({
					  title: "Successfully copied to clipboard",
					  text: "This message will close in 2 seconds.",
					  timer: 2000,
					  showConfirmButton: false,
					  type: "success"
					});
				});
			});

			$('#content_frame').ready( function() {
				$(this).contents().find("a").click(function(e){
					e.preventDefault();
					window.open($(this).attr("href"), '_blank');
				});
			});
		</script>
		<style>
			html, body {
			    width:100%;
			    height:100%;
			    margin:0;
				min-width:672px;
				overflow:hidden;
			}

			#clip{
			    color: white;
			    background: #262832;
			    padding: 10px;
			    height: 35px;
			    border: 0;
			    border-radius: 5px;
			    width: 100px;
			}

			#share_container{
				margin:10px auto;
			}

			#clip{
				cursor:pointer;
			}

			#share_container a i {
			    width:30px;
			    /* height: 17px; */
			    padding: 15px;
			    vertical-align: middle;
			    margin: -left10px;
			    background: #262832;
			    border-radius: 200px;
			    color: white;
			    text-decoration: none;
			    margin: 0 10px;
			    font-size:30px;
			}

			#wrapper {
			    width:100vw;
			    height:100%;
			    position:relative;
			}

			#header {
				background:#343949;
				text-align:center;
			}

			#header table{
				display:table;
				margin:0 auto;
			}

			.lds-double-ring{
				margin: auto;
				position: absolute;
				top: 0;
				left: 0;
				bottom: 0;
				right: 0;
			}
